import React from 'react'
import { PayPalButtons } from "@paypal/react-paypal-js";

export const PayPalPaymnet = () => {

  return (
    <PayPalButtons
      createOrder={(data, actions) => this.createOrder(data)}
      onApprove={(data, actions) => this.onApprove(data)}
    />
  );
}
